import React from "react";

const CenteredText = () => {
  return (
    <div className="center-text">
      <span className="allert-text">ALLERT</span>
      <small className="slog">forewarned is forearmed.</small>
      <button>Download</button>
    </div>
  );
};

export default CenteredText;
